Done right, espresso is the height of coffee drinking. Ethical Bean organic fairtrade espresso whole coffee beans are roasted with restraint to a medium dark roast, blending the best notes of cocoa and sugar for a bold espresso. Using our sophisticated Loring Smart Roaster in a carbon neutral facility, these organic coffee beans boast a multi-dimensional, full-bodied taste with a velvet mouthfeel that marries beautifully with milk. The whole espresso coffee beans are perfect for pulling off the ultimate espresso shot at home; after grinding, all you need is an espresso maker or moka pot for a stand-up straight shot of organic fair trade coffee. ;
;;
;Just like our other ground coffee varieties, Ethical Bean uses only fairtrade, organic coffee beans certified to be free from harmful chemicals and pesticides. We meet higher standards of social and environmental performance, transparency, and accountability - which shows through in our organic fair trade coffee.<ul><li>One 12 oz bag of Ethical Bean Sweet Espresso whole bean medium dark roast coffee</li><li>USDA organic coffee is grown free from harmful chemicals and pesticides</li><li>100% Fairtrade certified coffee</li><li>100% certified organic</li><li>100% Arabica coffee</li><li>Trace this coffee's unique journey by scanning the QR code on each pack with our free app or enter the lot number into our website</li></ul>

